La politique étrangère de la république de Chine, dénommée « Taïwan » par de nombreux États, traite des relations entre la République de Chine et les autres pays. La République de Chine est reconnue par 14 des 193 États membres des Nations unies, ainsi que par le Saint-Siège. En plus de ces relations, la République de Chine entretient des relations non officielles avec 57 membres de l'ONU via ses bureaux de représentation et consulats. Le passeport taïwanais a des accords d'exemption de visa avec 124 pays et Hong Kong (33e rang mondial) en 2018. Le gouvernement de la République de Chine a participé à la conférence de Moscou de 1943, à la Conférence de Dumbarton Oaks et à la conférence des Nations unies sur les organisations internationales et était un membre fondateur des Nations unies après avoir été membre de l'alliance qui a remporté la Seconde Guerre mondiale. En 1949, les nationalistes ont perdu la guerre civile chinoise en Chine continentale et se sont retirés à Taïwan, Penghu, Kinmen et Matsu. Malgré la perte importante de territoires, la République de Chine a continué d'être reconnue comme le gouvernement légitime de la Chine par l'ONU et par de nombreux États non communistes. En 1971, l'ONU a expulsé la République de Chine et transféré le siège de la Chine à la république populaire de Chine (RPC). En plus de la reconnaissance par une majorité de pays avant la résolution 2758 des Nations Unies, la République de Chine a perdu sa place de membre de toutes les organisations intergouvernementales liées aux Nations unies. L'ONU et des organisations comme la Cour internationale de justice étant le lieu le plus courant pour l'application effective du droit international et la communauté internationale d'États, la majorité des pays alignés sur l'Occident pendant la guerre froide ont mis fin à leurs relations diplomatiques avec Taipei au profit de Pékin. Les articles 23 et 110 de la Charte des Nations unies, dans son chapitre II, font explicitement référence à la République de Chine, mais le siège de la Chine est actuellement occupé par la RPC. La République de Chine continue d'entretenir des relations de facto y compris avec la plupart des organisations non gouvernementales aux Nations Unies, en plus de la préoccupation de l'UNESCO. La Convention de Vienne sur les relations diplomatiques a été signée et ratifiée par la République de Chine les 18 avril 1961 et 19 décembre 1969 y compris le Protocole facultatif concernant le règlement obligatoire des différends. L'article 35 de la Convention de Vienne sur le droit des traités de 1969, pierre angulaire de la diplomatie moderne, s'applique également à la République de Chine depuis 1971. En raison de la précarité de la situation de Taïwan et de son isolement dans les années 1970 et 1980 après son expulsion de l'ONU, ainsi que de l'influence américaine, la République de Chine s'est progressivement démocratisée et a adopté le suffrage universel, jusqu'au terme de la présidence dictatoriale de Chiang Ching-kuo. Les premières élections présidentielles directes ont eu lieu en 1996 et le président en exercice, Lee Teng-hui, fut élu. À compter du 4 mai 2015, les ressortissants de RDC sont éligibles pour un visa préférentiel dans 142 pays ou territoires. Les alliés traditionnels et stables de Taïwan comprennent les États-Unis, le Canada, le Japon, l'Australie et la Nouvelle-Zélande. La diplomatie culturelle de Taïwan comprend la création du Centre taïwanais de ressources pour les Études chinoises en 2012 dans les principales universités du monde. La RDC est l'un des principaux partisans de l'aide publique au développement avec le Fonds de coopération internationale pour le développement, qui gère les projets d'aide étrangère et de coopération internationale de la RDC. Depuis 2010, avec la Taiwan Relations Act, aux côtés d'autres alliés des États-Unis pour la sécurité, notamment l'Australie, la Nouvelle-Zélande, le Japon et la Corée du Sud, dans le cadre de la loi sur les relations taïwanaises, des fonctionnaires du RDC ont effectué des visites quasi officielles aux niveaux gouvernemental et politique, y compris les directives militaires coopératives taïwano-américaines dans le cadre des exercices annuels de forces conjointes Han Kuang. Les objectifs stratégiques communs de la déclaration commune du comité consultatif sur la sécurité américano-japonaise de 2005 et 2011 (et réitérée en 2013) comprenaient les objectifs suivants : 
* résolution pacifique des problèmes concernant le détroit de Taiwan grâce au dialogue ; 
* le rôle responsable et constructif de la Chine dans la stabilité et la prospérité régionales ; 
* la coopération de la Chine sur des questions globales ; 
* l'adhésion de la Chine aux normes internationales de comportement, et l'instauration de la confiance entre les États-Unis, le Japon et la Chine ; 
* ouverture et transparence concernant la modernisation militaire de la Chine ; 
* renforcer les mesures de renforcement de la confiance, compte tenu de la croissance rapide des investissements militaires chinois grâce aux investissements militaires en expansion rapide de la Chine. Le PIB de la RDC est supérieur à celui de plusieurs économies du G20. Dans le contexte de la norme internationale de tabula rasa, le ministère des affaires étrangères de la République de Chine reste de facto prêt à rejoindre la communauté internationale et (le cas échéant) en tant qu'entité sui generis du droit international par référence au principe ex factis jus oritur En tant qu'État non membre des Nations unies, en participant en tant que membres à une ou plusieurs institutions spécialisées des Nations unies et fonctionnant dans un système politique parallèle au Parti communiste chinois comme dans le cas de l'Allemagne et de la Corée, le statut d'observateur permanent peut être accordé à la République de Chine au sein d'organisations telles que le FMI et la Banque mondiale. L'implication et la participation à la conférence Asie-Pacifique sur l'innovation permettent une interaction avec le directeur de la Division de l'Économie et des Statistiques de l'OMPI, qui relève directement du directeur général. En raison de « l'absence d'entente entre les deux rives » du détroit de Formose (consensus de 1992), Taïwan subit l'isolement international sous l'administration pro-indépendance du parti démocrate progressiste, et il ne peut donc participer à l'Assemblée mondiale de la santé, à Interpol, l'Organisation de l'aviation civile internationale au processus de Kimberley, de possibles mesures internationales contre les activités du Comité olympique de Taipei chinois (nom de Taïwan aux Jeux Olympiques), Golden Horse Film Festival (boycotté), impossibilité pour les journalistes taiwanais d'entrer aux Nations unies et d'assister aux réunions de la CCNUCC. La société civile de la République de Chine participe actuellement à 11 projets liés aux objectifs de développement durable des Nations Unies. Taïwan occupe la 31e place sur 176 pays et territoires dans l'indice de perception de la corruption 2016 de Transparency International et figure dans la tranche B de l'indice de corruption de la défense le gouvernement.
